def cal_hamming_distamce(seq1, seq2):
    distance = 0
    if len(seq1) != len(seq2):
        raise ValueError("Sequences must be of equal length")
    for i in range(len(seq1)):
        if seq1[i] != seq2[i]:
            distance += 1
    return distance


print(cal_hamming_distamce("",
      ""))
